import React from 'react';
import Navbar from '../../components/Navbar';
import Footer from '../../components/Footer';
import '../../styles/Services.css';

const services = [
  { id: 1, name: 'Haircut', description: 'A stylish haircut tailored to your preference.', price: '$30' },
  { id: 2, name: 'Hair Coloring', description: 'Vibrant colors to enhance your look.', price: '$50' },
  { id: 3, name: 'Manicure', description: 'Pamper your hands with a professional manicure.', price: '$25' },
  { id: 4, name: 'Pedicure', description: 'Relax with a soothing pedicure.', price: '$30' },
  { id: 5, name: 'Facial', description: 'A rejuvenating facial for glowing skin.', price: '$40' },
  { id: 6, name: 'Massage', description: 'A relaxing massage to relieve stress.', price: '$60' },
];

const Services = () => {
  return (
    <div className="services-page">
      <Navbar />
      <div className="services-header">
        <h1>Our Services</h1>
        <p>Explore the range of services offered at Moon's Salon.</p>
      </div>

      <div className="services-content">
        {services.map((service) => (
          <div key={service.id} className="service-card">
            <h3>{service.name}</h3>
            <p>{service.description}</p>
            <p className="service-price">{service.price}</p>
            <button className="book-now-btn">Book Now</button>
          </div>
        ))}
      </div>

      <Footer />
    </div>
  );
};

export default Services;
